import React from "react";

const SolutionCard2 = () => {
  return (
    <div className="w-[400px] h-[150px] bg-[#392B85] flex justify-around items-center mt-12 rounded-lg text-left">
      <span className="ml-14">
        <img src="images/Vector6.png" alt="vector" />
      </span>
      <h1 className="text-[#000000] text-xl ml-12">
        Enhancing Clinical <br />
        Trails Access
      </h1>
      <span className="mt-[110px] justify-end ml-14">
        <img src="images/Ellipse1.png" alt="ellipse" />
      </span>
    </div>
  );
};

export default SolutionCard2;
